    public function test_puede_anular_gastos()
    {
        $faker = Factory::create('es_PE');
        $gastoData = [
            'id' => Gasto::where('estado', Gasto::APROBADO)->where('aut_especial', 24)->inRandomOrder()->value('id'),
            'detalle_estado' => $faker->text(200),
        ];
        $usuario = [
            "name" => "wcordova",
            "password" => "0750360919"
        ];
        $response_login = $this->post('http://localhost:8000/api/usuarios/login', $usuario);
        $headers = [
            'Authorization' => 'Bearer ' . $response_login->baseResponse->original['access_token']
        ];
        //Act
        $response = $this->post('api/fondos-rotativos/rechazar-gasto', $gastoData, $headers);
        //Assert
        $response->assertStatus(200);
    }

    private function generarArraySubDetalle()
    {
        $array = array();
        for ($x = 1; $x <= 3; $x++) {
            $array[] = SubDetalleViatico::inRandomOrder()->value('id');
        }
        return $array;
    }
    private  function randomFactura()
    {
        $randstring = '001';
        $randstring = $randstring . '-';
        $randstring = $randstring . '001-';
        for ($i = 0; $i < 9; $i++) {
            $randstring = $randstring . rand(0, 9);
        }
        return $randstring;
    }
